import React, { Fragment } from 'react';
import './Jumbotron.css';
function Jumbotron() {

    return(
    <Fragment>
        <div className="jumbotron">
            <h1 className="title">SuperHero Booth</h1>
        </div>
    </Fragment>
    )
}

export default Jumbotron;
